import React from 'react';
import Card from './Card';
import { NavLink } from 'react-router-dom';
import './ctCard__Div.css';

function CtCard(props) {
  return (
    <div>
      <Card width='450px' height='300px' margin='10px 5px' border='20px'>
        <div className='ct_card_div'>
          <img className='ct__img' src={props.image} alt='avatar image' />

          <h1>{props.ct_title}</h1>
        </div>
      </Card>
    </div>
  );
}

export default CtCard;
